import React from "react";
import NavegacionAdmin from "../../componentes/Componentes_admin/NavegacionAdmin";
import ContenidoOtrosiAdmin from "../../componentes/Componentes_admin/ContenidoOtrosiAdmin";
import ValidateRolAdmin from "../../componentes/Componentes_admin/ValidateRolAdmin";

const OtroSiContratistaAdmin = () => (
    <>
        <NavegacionAdmin />
        <ContenidoOtrosiAdmin />
        <ValidateRolAdmin />
    </>
);

export default OtroSiContratistaAdmin;
